    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from September through December of 1961.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. Resource management is outlined;
    topics include grazing. The public relations section discusses recreational uses,
    Refuge visitors, and Refuge participation. Items of interest, N-R forms, and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
